import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';

const age=19;
var display=age>18 ? "eligible" : "not eligible"


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(display);

